(1, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A watch which gains uniformly is 2 minutes low at noon on Monday and is 4 min. 48 secs fast at 2 p.m. on the following Monday. When was it correct?</div>\n', 1, 1, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(2, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">How many times in a day, the hands of a clock are straight?</div>\n', 1, 2, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(3, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">How many times do the hands of a clock coincide in a day?</div>\n', 1, 3, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(4, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">At what time, in minutes, between 3 o\'clock and 4 o\'clock, both the needles will coincide each other?</div>\n', 1, 4, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(5, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">At what time between 9 and 10 o\'clock will the hands of a watch be together?</div>\n', 1, 5, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(6, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">\r\n	If the minute hand of a clock has moved 300&ordm;, how many degrees has the hour hand moved______?</div>', 1, 6, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(7, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A clock is set right at 5 am the clock loses 16 mins in 24 hours. What will be the right time when the clock indicates on 3 pm the 8th day?</div>\n', 1, 7, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(8, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">At what angle, are the hands of a clock inclined at 15 minutes past 4? </div>\n', 1, 8, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(9, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">What is the angle between the hands of the clock at 7:20?</div>\n', 1, 9, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(10, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Rohit has a watch that gains 5 seconds in 3 minutes. It was set right at 9 a.m. in the morning. In the afternoon of the same day, when the watch indicated 4 o\'clock, how much time will the watch have gained____?</div>\n', 1, 10, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(11, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The Perimeter of a rectangular field is 480 mts & the ratio between the length & breadth is 5:3, the area of the field is ________ mts?</div>\n', 1, 11, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(12, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">If the length & breadth of a rectangle plot are increased by 50% and 20% resp, then the new area is how many times the original area?</div>\n', 1, 12, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(13, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The length of a rectangle is increased by 60%. By what percent would the width have to be decreased to maintain the same area?                           </div>\n', 1, 13, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(14, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A hall 20 mts long & 15 mts broad is surrounded by a verandah of uniform width of 2.5 mts. The cost of flooring the verandah at Rs 3.50 per sq.mts is ________?</div>\n', 1, 14, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(15, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The ratio of the area of a square to that of the square drawn on its diagonal is _______?</div>\n', 1, 15, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(16, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">If the ratio of the areas of two squares is 9: 1, the ratio of their perimeters is _____?</div>\n', 1, 16, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(17, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">If the diagonal of a rectangle is 17 cms long & the perimeter of the rectangle is 46 cms, then the area of the rectangle is _____ cm&sup2;?</div>\n', 1, 17, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(18, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">If the perimeter of a rectangle and a square, each is equal to 80 cms & the diff. of their areas is 100 sq.cm, the sides of the rectangle are: ______ & _______ cms? </div>\n', 1, 18, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(19, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A rectangular field has dimensions 25 mts by 15 mts. Two mutually perpendicular passage 2 m wide have been left in the central part. In the rest of the field, grass has been grown. The area under the grass is ________?</div>\n', 1, 19, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(20, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The length of a rectangle is doubled, while its breadth is halved. What is the change in area? </div>\n', 1, 20, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(21, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A rectangular carpet has an area of 120 sq.mts& a perimeter of 46 mts. The length of the diagonal is _______ mts?</div>\n', 1, 21, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(22, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">One side of a rectangle is 5 mts long &its diagonal measures is 13 mts. The area of the rectangle is ________ sq.mts?</div>\n', 1, 22, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
(23, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The Threesides of a triangle are 3 cms, 4 cms & 5 cms resp. Then its area is ________ sq. cm?</div>\n', 1, 23, 1, 1, '2023-09-30 12:23:56', 0, NULL, NULL, '', '', NULL, NULL),
