(63, '<div style=\"font-weight:bold;\">Use the data of those statements and then determine which of the following statements is necessary to answer the question.</div>\n<div style=\"font-weight:bold;\">A) Statement I is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">B) Statement II is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">C) Either Statement I or statement II is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">D) Neither Statement I nor statement II is sufficient to answer the question.</div>\n<div style=\"font-weight:bold;\">E) Both Statements I and II are necessary to answer the question.</div>\n<div style=\"font-weight:bold;\">How many words are there in the page?</div>\n<div style=\"font-weight:bold;\">Statement I: Pavithra will take 5 minutes less to type the page at an average speed of 250 words per minute than the time taken to type the page at an average speed of 125 words per minute</div>\n<div style=\"font-weight:bold;\">Statement II: Pavithra will take 14 minutes to type the first half of the page at an average speed of 130 words per minute.</div>\n', 1, 33, 2, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
