(70, '<div style=\"font-weight:bold;\">In each of the following questions, a question is followed by three statements I, II and III. Read all the statements to find the answer to given question and then answer accordingly that which statement/s can give the answer alone/together.</div>\n<div style=\"font-weight:bold;\">Find the amount earned by Rohan on the sum on compound interest at 8% per annum after 3 years? </div>\n<div style=\"font-weight:bold;\">I. The same sum amounts to Rs58427.2 on compound interest at 6% per annum after 2 years.</div>\n<div style=\"font-weight:bold;\">II.The same sum amounts to Rs68640 on simple interest at 8% per annum after 4 years.</div>\n<div style=\"font-weight:bold;\">III.Difference between the compound interest and simple interest on that sum at 10% per annum after 2 years is Rs520</div>\n', 1, 40, 2, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(71, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">On dividing 50 into two parts, such that the sum of their reciprocals is (1/120), we get the parts as ____,____?</div>\n', 1, 1, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(72, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">&ldquo;243&rdquo; has been divided into 3 parts such that half of the first-part, one-third of thesecond-part & one-fourth of the third-part are equal. The largest part is _____?</div>\n', 1, 2, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(73, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The sum of 3 consecutive odd numbers is 57, the middle one is _______?</div>\n', 1, 3, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(74, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The sum of three consecutive integers is 102. Find the lowest of the three?</div>\n', 1, 4, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(75, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The sum of two digits of a number is 10. If the number is subtracted from the number obtained by reversing its digits, the result is 54. Find the number?</div>\n', 1, 5, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(76, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The numerator of a certain fraction is 8 less than the denominator. If 3 is added to the numerator and 3 is subtracted from the denominator, the fraction becomes (3/4). Find the original fraction?</div>\n', 1, 6, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(77, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">In a meet, persons from five different places have assembled in aGovt. High School. From the five places, the persons come to represent are 42, 60, 210, 90 and 84. What is the minimum number of rooms that would be required to accommodate, so that, each room has the same number of occupants and occupants are all from the same places?</div>\n', 1, 7, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(78, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The sum of all two digit numbers divisible by 5 is_______?</div>\n', 1, 8, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(79, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">When twice the original number is divided by the same divisor, the remainder is 11. What is the value of the divisor?</div>\n', 1, 9, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(80, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Find the number which when multiplied by 15 is increased by 196?</div>\n', 1, 10, 3, 1, '2023-09-30 12:23:57', 0, NULL, NULL, '', '', NULL, NULL),
(81, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average of first five multiples of 3 is ______?</div>\n', 1, 11, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(82, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average of the first 50 whole number is _______?</div>\n', 1, 12, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(83, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average of 7 consecutive numbers is 33, the largest of these numbers is _______?</div>\n', 1, 13, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(84, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average height of 30 boys out of a class of 50 is 160 cms. If the average height of the remaining boys is 165 cms, the average height of the whole class is _______ cms?</div>\n', 1, 14, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(85, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average of 5 results is 46 and that of the first 4 is 45. The fifth result is _______?</div>\n', 1, 15, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(86, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average of ten numbers is 7. If each number is multiplied by 12, then the average is _____?</div>\n', 1, 16, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(87, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average of 50 numbers is 38. If two numbers, namely 45 and 55 are discarded, the average of the remaining number is _______?</div>\n', 1, 17, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(88, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The mean of 100 observations was calculated as 40. It was found later on that one of the observations was misread as 83 instead of 53. The correct mean is _______?</div>\n', 1, 18, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(89, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average of six numbers is 30. If the average of first four is 25 and that of last three is 35, the fourth number is _______?</div>\n', 1, 19, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(90, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Out of four numbers, the average of first three is 16 and that of the last three is 15. If the last number is 18, the first number is _______?</div>\n', 1, 20, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(91, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A motorist travels to a place 150 kms away at an average speed of 50 kms per hour and returns at 30 kms per hour. His average speed for the whole journey is _______km/hr?</div>\n', 1, 21, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(92, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average age of 30 students is 9 years  If the age of their teacher is included, it becomes 10 years  The age of the teacher is _______ years?</div>\n', 1, 22, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(93, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average weight of 8 men is increased by 1.5 kgs when one of the men who weight 65 kgs is replaced by a new man. The weight of the new man is _______?</div>\n', 1, 23, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(94, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average of 5 consecutive numbers is &ldquo;n&rdquo;. If the next two numbers are also included, the average is _______?</div>\n', 1, 24, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(95, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A team of 8 persons join in a shooting competition. The best marksman scored 85 points. If he had scored 92 points, the average score for the team would have been 84. The number of points the team scored was _______?</div>\n', 1, 25, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(96, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A cricketer has a certain average for 9 innings. In the tenth inning he scores 100 runs, thereby increasing his average 8 runs. His new average is _______?</div>\n', 1, 26, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(97, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Three years ago, the average age of 5 members was 17 years. A baby having been born, the average age of them all is the same today. The present age of the baby is ____ yrs?</div>\n', 1, 27, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(98, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Five years ago, the average age of A, B, C and D was 45 years  With E joining them now, the average of all five is 49 years. How old is E?</div>\n', 1, 28, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(99, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average age of a class is 15.8 yrs. The average age of the boys in the class is 16.4 yrs while that of the girls is 15.4 yrs  What is the ratio of boys to girls in the class?</div>\n', 1, 29, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL),
(100, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The average age of husband, wife and their child 3 years ago was 27 years and that of wife and the child 5 years ago was 20 years. The present age of the husband is _______?</div>\n', 1, 30, 3, 1, '2023-09-30 12:23:58', 0, NULL, NULL, '', '', NULL, NULL);
